import { Component } from "react";
import "./navbar.css";
import PersonIcon from '@mui/icons-material/Person';
import MenuIcon from '@mui/icons-material/Menu';
import CloseIcon from '@mui/icons-material/Close';

class Navbar extends Component {
state={clicked:false};

handleClick = () =>{
  this.setState({clicked:!this.state.clicked});
}
render(){
  return (
    <>
      <nav>
        <section className="nav-left">
          <h1>RiVVE</h1>
          <ul className={this.state.clicked?"nav-mobile":"navbar"}>
            <li><a href="#">Home</a></li>
            <li><a href="#">About</a></li>
            <li><a href="#">Hostels</a></li>
            <li><a href="#">Contact</a></li>
          </ul>
        </section>
        <section className="nav-right">
          <p>Already a member?</p>
          <button>LOGIN</button>
          <button>SIGNUP</button>

    <PersonIcon fontSize="large" className="person-icon" />

        </section>
        <div className="mobile" onClick={this.handleClick}>
       {this.state.clicked? <CloseIcon className="icon" sx={{
          display: {
            xs: "none", // Hide on extra-small screens
            sm: "block", // Show on small screens and above
          },
          fontSize: "3rem",
        }}/>:<MenuIcon fontSize="large" className="icon"/>} 
    </div>
      </nav>
    </>
  );
}

}

export default Navbar;
